const addAllProducts = (data)=>{
    return {
        type : 'ALL_PRODUCTS',
        payload  : data
    }
}
const addSearch = (data)=>{
    return {
        type : 'SEARCH',
        payload : data
    }
}

export {addAllProducts ,  addSearch}
